 class Navbar extends React.Component {
    render() {
        return (
            <>
            <nav className="navbar">
                <div className="logo">
                    <img src={logo}></img>
                </div>
                <ul>
                    <li><a href='#'>product</a></li>
                    <li><a href='#'>features</a></li>
                    <li><a href='#'>pricing</a></li>
                </ul>
                <div><li> <a href='#'>login</a></li></div>
                {/* <img src={banner}></img> */}

            </nav>
            </>
        )
    }
}

export default Navbar;
